branchCategory.description:
&lt;p&gt;
The MQQ metal seal cylinder is a compact, low friction cylinder designed for low pressure, low speed, uniform speed or low friction applications. MQQ is available as standard or a lateral load resisting type (with built-in ball bushings). Bore sizes range from 10mm to 28mm and strokes are available up to 100mm.
&lt;/p&gt;

branchCategory.bullets:
&lt;UL&gt;
&lt;LI&gt;Low friction, metal seal cylinders
&lt;LI&gt;Bore sizes: 10, 16, 20, 25, 32, 40mm
&lt;LI&gt;Available in a lateral load resisting type
&lt;LI&gt;Long service life of 10,000 km for 100 million full cycles&lt;/LI&gt;&lt;/UL&gt;

